import React from 'react';
import { Button, Card } from 'react-bootstrap';
import '../projectsStyle.css';

const Portofolio: React.FC = () => {
  return (
    <>
      <h2 className="text-center mb-5">Last Project</h2> {/* Here's the title outside of the Card */}
      <Card className='cardStyle'>
        <Card.Img variant="top" src="/img/ecommerce.jpg" />
        <Card.Body>
          <Card.Title>E-Commerce Website</Card.Title>
          <Card.Text>
            Shop-On Website created for laptop buyers
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
    </>
  );
}

export default Portofolio;
